import React from "react";

function DeckEdit() {
  return (
    <div>
      <h2>Edit Deck</h2>
      <div class="form-group">
        <label class="col-form-label" for="deckName">Name</label>
        <input type="text" class="form-control" placeholder="Deck Name" id="deckName" />
      </div>
      <div class="form-group">
        <label for="deckDescription">Description</label>
        <textarea class="form-control" placeholder="Brief description of the deck" id="deckDescription" rows="3"></textarea>
      </div>
    </div>
  );
}

export default DeckEdit;
